import React from 'react'
import '../styles/NavStyles.css';

export const Navbar = () => {
  return (
    <>
        <div className="nav-contain">
               <div className="nav-main">
                    <a href="/" className='sephora-btn'>
                        <img className='' src="https://www.sephora.com/img/ufe/logo.svg" alt="Sephora" />
                    </a>
               </div>
        </div>
    </>
  )
}
